import React from 'react';
import Freedom from '../Components/Freedom/Freedom';
import Round from '../Components/Round/Round';
import Popular from '../Components/Popular/Popular';
import Grid from '../Components/Grid/Grid';
import VideoSection from '../Components/video/VideoSection'; // Correctly import as VideoSection
import WhatsAppChatWidget from '../Components/WhatsAppChatWidget/WhatsAppChatWidget';

const Home = () => {
  return (
    <div>
      <Freedom />
      <Round />
      <br />
      <Popular />
      <br />
      <Grid />
      <br />
      <VideoSection /> {/* Use VideoSection correctly */}
      <br />
      <WhatsAppChatWidget />
      <br />
    </div>
  );
};

export default Home;
